import React from 'react'

const Plans = () => {
  const plans = [
    {
      planName: "Management 101",
      price: "1200",
      desc: "Actualize your business model and boost your KPIs",
      validity: "Valid for 3 months",
      btn: "Select"
    },
    {
      planName: "Financial Strategy",
      price: "1450",
      desc: "Add value and maximize your competitive advantage",
      validity: "Valid for 6 months",
      btn: "Select"
    },
    {
      planName: "Data and Digital Sol",
      price: "2500",
      desc: "Harness the power of technology to upgrade your business",
      validity: "Valid for 12 months",
      btn: "Select"
    },
  ];

  return (
    <div className="">
      <div className="container mb-5">
        <h1 className="heading text-center"> PROJECTS </h1>
      </div>
      <div className="container mb-5">
        <div className="row mt-5 p-3">
          {plans.map((item, idx) => {
            return (
              <div className="col-lg-6 border p-5" key={idx}>
                <h6 className="mt-5">{item.planName} </h6>
                <h1 style={{ marginTop: 60 }}> <sup> $  </sup>{item.price} </h1>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default Plans;
